(13, 'LAKESHORE TOWERS', 'Kunwars Associates', 'project/13/developer-logo.jpg', 'project/13/project-image.jpg', '1', 'Lakeshore Towers is ideally located adjacent to the New Islamabad International Airport and is minutes away from Metro Bus Terminal and M1/M2 Motorway. Downtown Islamabad and Rawalpindi are at a 20 minutes short drive. Nothing is ever far away from Lake Shore Towers.\r\n\r\nSituated right across a lake in the heart of TopCity-1, Lakeshore Towers provides a perfect combination of tranquility and accessibility. This smart and green building is designed to offer a posh look with world-class facilities. Built with the best, we have created with love the perfect space to support the flow of your lifestyle..', '1.00 Crore', '10.00 Crore', 705, 'active', '1652767804', '1653474110'),
(15, 'New Metro City Housing Scheme', 'BSM Developers', 'project/15/developer-logo.jpg', 'project/15/project-image.jpg', '17', 'A signature project from the House of BSM Developers ‘New Metro City’ is located at a historic crossroad between Kharian and Sarai-Alamgir. \r\n\r\nNew Metro City is a master planned community. A complete housing project with state of the art amenities, Monumental master pieces and all other facilities required for a complete living.\r\n\r\nFrom the house of Mr. Malik Riaz Hussian, Mr. Bilal Malik (Grandson of Mr. Malik Riaz) continues the legacy of his family by introducing a housing project in Kharian Sara-e-Alamgir. Being a developer we aim to provide safe investment opportunities to people.Having a vast experience of real estate development and success in Gwadar Golf City we intend to give people of Kharian, a complete community which can add value to their lives and enhance their living standard.', '11 lacs 75 thousand', '1 carore 15 Lac', 290, 'active', '1653481440', '1653994479'),
(16, 'THE GRID MALL', 'Khuld Builders & Developers', 'project/16/developer-logo.jpg', 'project/16/project-image.jpg', '2', 'The Grid is a one-of-a-kind shopping complex with high-end corporate offices. The project aims to provide an idyllic platform for brands and multinational companies alike. With no shortage of fashionable facilities, a spectator design layout and a prime location, the venue is set to be your destination for a mind-blowing experience.\r\n\r\nThe Grid stands high with its unrivalled grandeur – opposite Quaid-e-Azam International Hospital on main Grand Trunk Road, is ideal for retail brands, international organizations, and local businesses alike. Besides its commercial appeal, the location is equally convenient for the customers and shoppers, with easy access to Saddar, Blue Area, and Peshawar/Islamabad Motorway. Located in downtown Rawalpindi, it is set to be the next economic and commercial hub for businesses, opening new avenues for investors and stakeholders alike.', '1.00 Crore', '10.00 Crore', 276, 'active', '1653482498', '1653482498'),
(17, 'Infinity Business Center', 'Infinity Business Center', 'project/17/developer-logo.jpg', 'project/17/project-image.jpg', '1', 'The latest feather in the impressive portfolio of S.A.Global is the Infinity Business Center, a commercial building for retail and commerce businesses, offering to its potential occupants a once in a lifetime opportunity to own and operate in one of the most sought after location, on Gulyana Road in Mumtaz City. For offering, IBC is composed of two floors of prime retail shops topped with six floors of premium office spaces.', '29 Lac 40 thousand', '1.00 Crore 97 lac 50', 247, 'active', '1653568856', '1653994277'),
(19, '5 West Mumtaz City', 'SA Holidings', 'project/19/developer-logo.jpg', 'project/19/project-image.jpg', '1', '5 West - Mumtaz City\r\n\r\nA Project by S.A. Holdings\r\nWith the dream to “rise above”, SA Holdings aims to provide superior living by creating new standards in real estate development. SA Holdings is based on the core principles of honesty, professionalism and unprecedented commitment. Their unparalleled dedication and resolve for luxury construction is aimed at offering the absolute best in each of their ventures. To fulfill their dream, SA Holdings is launching “5 West” on the main dual carriageway of main Civic Commercial no. 5.\r\n\r\nIdeal Location\r\n5 West has the potential to become a booming commercial hub due to its design and location. The project is situated on the main dual carriageway that serves as a bypass for incoming local and national traffic from KPK, Southern Punjab and Sindh.\r\n\r\n5 mins from Airport\r\n5 mins walk to Metro Station\r\n5 mins from M1 and M2 motorways\r\n5 mins from Srinagar Highway\r\n5 mins from CPEC Route\r\n15 mins from Zero Point\r\n25 mins from PIMS Hospital\r\n25 mins from Blue Area\r\n25 mins from F-10 Markaz\r\nProject Features\r\nVictorian inspired elevation\r\nExcellent visibility\r\nWide and spacious balconies\r\nEarthquake resistant structure\r\nAmple parking in the rear and front\r\nEnergy saving electrical system and SMD ceiling lights\r\nHigh glazed aluminum windows for insulation\r\nLarge windows for a better view and sunlight\r\nOTS for natural ventilation\r\nImported high-quality tiling\r\nPre-installed LAN cables for offices\r\nWooden doors\r\nPremium finishing\r\nRoof top dining\r\n24/7 CCTV monitoring\r\nProfessional tenant management\r\nCommunity Features\r\nWide carpeted road (40 to 150 feet wide)\r\nGuarded entrance\r\nDirect entrance from Main Srinagar Highway\r\nParks and green spaces\r\nShopping malls and cinema\r\nClass III markets\r\nMosques\r\n5 star hotel\r\nSecurity patrolling force\r\nMulti-story residential and commercial complexes\r\nUnderground electricity, gas, and cable and telephone network\r\nGarbage collection and disposal unit\r\nSewerage treatment plant\r\nOverhead water tank\r\nUnderground water supply, sewerage and drainage lines\r\nLocation\r\nSir Syed Ahmed Avenue, Mumtaz City, Adjacent to Srinagar Highway and at the juncture of  M1 and M2 Motorway Interchange, N80 and New Islamabad International Airport.', '5,636,610 lac', '2 carore 75 lac 4400', 381, 'active', '1653997598', '1653997598'),
(20, 'Eighteen Islamabad - Buy Luxury Villas in Islamaba', 'Eighteen Islamabad', 'project/20/developer-logo.jpg', 'project/20/project-image.jpg', '1', 'Eighteen Islamabad is offering state of the art luxurious villas and apartments equipped with world-class amenities and facilities. Eighteen Islamabad is on its way to becoming the most luxurious and exclusive housing project in Pakistan. The society promises to provide world-class amenities and luxuries to its residents. \r\nThe Eighteen Islamabad is expected to provide world-class residences, an impressive masterplan, and a premium location for those looking to transform their living space into a lavish lifestyle. The Eighteen Islamabad will be a beautiful blend of apartments and villas built in a distinctive style.\r\n\r\nFor Booking and Details Please call/WhatsApp \r\nCall: +92-330-6969698\r\n\r\nEighteen Islamabad Developers:\r\nOra Developers, Kohistan Builders and Developers, and Saif Group Ora Developers collaborated to create The Eighteen Islamabad, a spectacular residential complex. The developers are well-known in the real estate industry, having had a string of big venture successes. Zircon Heights in the G-15 sector is the invention of Kohistan builders and developers. Mr. Naguib Sawiris, a billionaire, is the owner of Ora developer. In the past, he also owned Mobilink, Pakistan’s largest mobile network.\r\n\r\nWork History of Ora Developers:\r\nOra Developers is a well-known company in the real estate industry with a long track record of success. They’ve launched several successful businesses, including:\r\n\r\nNocera Limited:\r\nSilversand:\r\nNile City:\r\nAyia Napa Marina\r\nPyramid Hills\r\nZed\r\nNorth Coast\r\nUnveiling of Eighteen Islamabad:\r\nThe initial launch of the eighteen Islamabad took place in December 2017, with the final commercial presentation on February 18, 2018. The venture was eloquently launched at an event. Many well-known and influential people from around the world attended the event. Thus, The Eighteen Islamabad made an excellent first impression.\r\n\r\nEighteen Islamabad No Objection Certificate:\r\nThe Capital Development Authority would shortly approve the Eighteen Islamabad. We expect the eighteen Islamabad to receive its No Objection Certificate from the Capital Development Authority soon because the society will be developed on lawful land, and there will be no illegal development in the plan. The CDA will shortly approve the venture’s Masterplan and NOC.\r\n\r\nEighteen Islamabad Location:\r\nThe Eighteen Islamabad enterprise is located on the Kashmir Highway, a great neighborhood. It’s around five kilometers from Golra Mor and less than three kilometers from the Islamabad-Lahore exit. The Eighteen Islamabad is the nearest residence to Islamabad and is within a short distance from the International Airport of Islamabad. In the area of the Eighteen Islamabad lies the University town, an old housing scheme. The place is relatively simple and can be found using Google Maps. Many well-known housing developments, such as Top City and Taj Residencia, are located near the venture.\r\n\r\nAccessibility Points:\r\nThe Eighteen Islamabad is easily accessible from many places; mentioned below are some of them.\r\n\r\nThe Eighteen Islamabad is an eleven-minute drive away from the Islamabad-Lahore Motorway (M2).\r\nThe venture is seven minutes away from the Islamabad-Peshawar Motorway (M1).\r\nIt is a six-minute drive away from the interchange of the Islamabad motorway.\r\nThe project is a thirteen-minute drive away from the Islamabad International Airport.\r\nIt is a three-minute drive away from the Tarnol Highway.\r\nØ  Nearby Landmarks:\r\nWritten below are the nearby Landmark from the Eighteen Islamabad:\r\n\r\nIslamabad International Airport.\r\nDHA\r\nBahria Town\r\nUniversity Town\r\nIslamabad\r\nMumtaz City\r\nTop City\r\nBlue Area\r\nEighteen Islamabad Masterplan:\r\nThe Eighteen Islamabad has a massive masterplan totaling 2.7 million square yards. The project includes two thousand residential units and 1,688 villas of various sizes. In addition, there are nine hundred flats in the commercial sector geared to the venture’s middle and upper classes. Calisson RTKL abstracted the master plan, which was created by the well-known planner WATG. A one-of-a-kind gold course is also expected to join the venture, intended by IDG. It’s similar to the Capital Smart City Golf Course.\r\n\r\nEighteen Islamabad Venture Details:\r\nEighteen Islamabad is a massive project that spans over 700 acres. Its impressive planning and infrastructure are anticipated to go for the heights. Two thousand residential complexes, nine hundred commercial units, and 1068 villas will be built as part of the project. Keeping the vision in mind, the Eighteen Islamabad will undoubtedly succeed. The opulent villas will be made on eight Kanal, four Kanal, one Kanal, and ten Marla of land. Residents can select the one they want and the one that best meets their needs and budget. Furthermore, the villas will provide a stunning view of nature and a relaxing ambiance.\r\n\r\nEighteen Islamabad Villas:\r\nThe Eighteen Islamabad Villas are luxurious and magnificent residences with 8,4,2 and 1/2 Kanal villas. It’s best for individuals with large families or who like to live in a vast space. These villas will provide luxury living in a safe environment.', '4 carore', '37 carore', 579, 'active', '1653999081', '1653999081'),
(21, 'GIGA Mall Extension', 'GIGA GROUP', 'project/21/developer-logo.jpg', 'project/21/project-image.jpg', '1', 'After Giga Mall’s success, the Giga Group is introducing the urban hub of the twin cities, Giga Mall Extension. The skyscraper will consist of 30 floors of shopping, recreation, entertainment, leisure, lifestyle, and work. A beautifully designed mosque will also be built right on top of the building with breathtaking views of the twin cities. It will also have a state-of-the-art cinema, kid’s play areas, food courts, restaurants, luxury hotels. What’s more, the floors will have the help of escalators for easy access to all levels. Also, this unprecedented structure will directly connect with already operational Giga Mall and D-Mall, making a chain of buildings to shop, dine or relax. Overall, the Giga Extension project is sure to add a new apex to Islamabad’s ever-growing skyline.\r\nLuxury Hotel Apartments\r\n\r\nWorld\'s Highest Mosque\r\n\r\nPakistan\'s First Vertical Market\r\n\r\nDepartmental Stores\r\n\r\nNational and International Brands\r\n\r\nMultiple Food Courts\r\n\r\nMedical Stores\r\n\r\nRest Areas\r\n\r\nRecreation Lounges\r\n\r\nCinema\r\n\r\nTourism floors\r\n\r\nRestaurants\r\n\r\nSwimming Pools\r\n\r\nGym\r\n\r\nPlay Area\r\n\r\nFun City\r\n\r\n3D Entertainment Area\r\n\r\nIndoor Sports\r\n\r\nIntelligent WiFi Integration\r\n\r\nSafety features\r\n\r\nSecurity cams\r\n\r\nSafe multi-storey Car Parking\r\n\r\nLocated at Prime Location DHA Phase II Islamabad\r\n\r\nExpected High Rental Returns\r\n\r\nEasy Payment Plan', '70 LAC', '5 CARORE', 390, 'active', '1654000082', '1654000129'),
(22, 'ZETA MALL DHA', 'Zeta 1 Mall & Apartments', 'project/22/developer-logo.jpg', 'project/22/project-image.jpg', '1', 'Zeta-1 Mall Islamabad is a brand new emerging and legal project located in the center of Islamabad. Zeta-1 offers an advanced shopping mall on lower levels and luxury living apartments on upper ones. It is a sign of extravagance and elegance. It is a project of Zaraj Group Builders.\r\n\r\nZeta-1 Mall is going to become worth the addition into the Real Estate Market of Islamabad and Rawalpindi. This project is just started, but the development work is happening at a great pace. However, investors are already showing great interest. The upcoming development is worth investing in because of Zeta-1 Mall’s specifications.\r\n\r\nZETA-1 Mall Islamabad Developers and Owners:\r\nThe developers of ZETA-1 Mall Islamabad are Zaraj Group Builders. The Zaraj Group Builders stands famous in the real estate market of the twin cities.\r\nThe project is popular because of the developers’ Zaraj Housing Scheme. The firm wishes to run & achieve several kinds of residential & commercial schemes. The Zaraj Group Builders strives to provide international standard facilities & amenities to its citizens. There several other successful projects include:\r\n\r\nZaraj Housing scheme Islamabad\r\nZaraj Residencia Islamabad\r\nZaraj Center Rawalpindi\r\nRania Heights Islamabad\r\nAlso, all projects are a marvel of construction & luxury.\r\n\r\nMeanwhile, S.G. Architects is the leading architectural firm of this project. Such an architectural firm aims to enhance a specialized attitude observance in terms of services & client fulfillment. It delivers the best solution for every design experiment. It constructs buildings that idealize balance of beautiful residence & reasonable rates in one place.\r\n\r\nZETA-1 Mall Islamabad NOC:\r\nThe No Objection Certificate (NOC) of ZETA-1 Mall Islamabad is approved by the Capital Development Authority (CDA). The registration no. of ZETA-1 Mall NOC is CDA/D-BC-II-6(21)/ZHS/Zone-V/2018/311. Moreover, it is one of the few approved projects by CDA in Islamabad Zone-5 Islamabad.\r\n\r\nThus, the legality of ZETA-1 Mall Islamabad is not questionable because once the possession is legal, the investors completely trust the property with their precious investments.\r\n\r\nZETA-1 Mall Islamabad Location:\r\nThe Location of ZETA-1 Mall in Islamabad is ideal as it is situated in front of Giga Mall.', '1.10 carore', '12.10 carore', 390, 'active', '1654000930', '1654000930'),
(23, 'The Micro', 'The Micro', 'project/23/developer-logo.jpg', 'project/23/project-image.jpg', '1', 'Paradigm Pakistan: a team of passionate real-estate builders & developers are bringing you their most exciting project yet. The very 1st smart & luxurious building in Bahria Town Rawalpindi. Paradigm Group of Companies is committed to following its philosophy of innovation & excellence in the real estate industry by bringing a new project: The Micro, which will be the 1st purely residential hotel/commercial hub to let you enjoy the taste of luxury and comfort.\r\n\r\nFacilities\r\nJUST 25% DOWNPAYMENT\r\nNOC APPROVED.\r\nLUXURY LIVING\r\nPLAY AREA\r\nGYMNASIUM & SPA\r\n2 BED STUDIO APPARTMENTS\r\nVERTICAL VILLAS\r\nHEALTHY LIVING', '80 lac', '3 carore', 281, 'active', '1654001385', '1654001385'),
(24, 'Mall 8 Mumtaz City', 'S.A Globel', 'project/24/developer-logo.jpg', 'project/24/project-image.jpg', '1', 'A lifelong journey and operational experiences of over 4 decades, Mumtaz Construction Company is proud to announce and bring to you, a project close to our heart, Mall VIII. An architectural marvel comprising of high standard retail outlets, luxury apartments, rooftop dining, swimming pool and gym. With breathtaking scenic park...\r\n\r\nRead More\r\nAN EXCEPTIONAL LOCATION\r\nMall VIII is located on one of the most prime commercial areas of Mumtaz City, nearby important access points are:\r\nA mere distance of 5 minutes from the New Islamabad International Airport10 minutes walking distance from Metro Bus Station10 minutes drive from G-14 Sector2 minutes from M1 & M2 MotorwayAccess to Srinagar HighwayConstructed on 80 feet wide dual carriage carpeted road (Fatima Jinnah Avenue\r\nThis is a safe and secure community with gated entry & exit and 24/7 security surveillance. It offers every convenience as the project encompasses power backup, professional tenant management, mosque, spacious parking space, high-speed elevators, rooftop restaurant, swimming pool, & gym.\r\nMoreover, the units are available on a flexible payment plan. Possession of the units will be offered within 24 months of booking and registry will be given at the time of possession.', '37.8 Lakh', '4.05 Crore', 372, 'active', '1654161529', '1654161529'),
(25, 'VALENCIA HEIGHTS', 'Valencia developers pvt  ltd', 'project/25/developer-logo.jpg', 'project/25/project-image.jpg', '1', 'Valencia Heights B17 Islamabad\r\nThe project is a multi-story beautifully designed building in which there are Studio, 1-Bed, 2-Bed, and 3-Bedroom luxury apartments available at an affordable payment plan. All these units are equipped with world-class features and facilities.\r\nValencia Heights Location\r\nThe project is located in Faisal Margalla City, Sector B-17, Islamabad which is easily accessible from all the prime locations of the twin cities (Islamabad/Rawalpindi). The project is only 20 kilometers away from G-13, and 25 kilometers away from F-11 Islamabad.\r\n\r\nApartments In Valencia Heights\r\nThe project is offering well-planned beautifully designed Studio, 1-Bedroom, 2-Bedroom, and 3-Bedroom luxury apartments at an affordable payment plan.\r\n\r\nStudio Apartment (245 sq. ft.)\r\n1-Bed Apartment (540 sq. ft.)\r\n2-Bed Apartment (790 sq. ft.)\r\n3-Bed Apartment (1180 sq. ft.)\r\nValencia Heights Payment Plan\r\n\r\nWe are providing the best and most affordable rates in FMC, B-17\r\nIslamabad. Our payment plans for Valencia Heights (a fully family\r\nresidential project that includes studio, single, double, triple bed\r\napartments and Penthouses), start from just Rs.10,200/- per sqft on\r\nthe 12th and 13th floors and Rs.500/- added per sqft on the 2nd to\r\n11th floors.\r\nOn the 14th floor, the penthouse rate is 13,000/- per sqft, while on the\r\n15th floor it\'s 16,000/- per sqft.\r\n\r\nArea of circulation will be included. \r\nFour years payment plan. \r\nFour years project completion. \r\n10% extra charges for corner apartments. \r\nReserved car parking charges will be paid on possession. \r\n\r\nFor Smart Apartments, Rs. 1700/- per sqft will be added in actual rate. \r\nFor Executive Smart Apartments, Rs. 2200/- per sqft will be added in actual rate. \r\nFor Furnished Apartments, Rs. 2000/- per sqft will be added in actual rate.\r\n\r\nFeatures & Facilities\r\nModern Architecture\r\nElectricity\r\nSui Gas\r\nWater\r\nSecurity\r\nCCTV Surveillance\r\nCar Parking\r\nTiled Flooring\r\nLifts & Cargo Lift\r\nWide Walkways\r\nHigh-quality Wood Finishes\r\nInternational Standard Finishing & Fittings\r\nNearby Gyms, Restaurants, Hospitals, Markets, Schools, Colleges & Universities.\r\nFor Booking & Information\r\nCall/WhatsApp: 0333-5600062', '3,468,000', '56,738,560', 420, 'active', '1654945680', '1667543434'),
(26, 'J7 Signature Hotels Islamabad', 'J7 Group', 'project/26/developer-logo.jpg', 'project/26/project-image.jpg', '1', 'Signature Hotel and Residence is J7 Group\'s flagship project and Pakistan\'s first high-rise Five Star Hotel. \r\n\r\n-The Project is at a Prime Location, in the heart of Islamabad, at the doorstep of Islamabad Airport, on main Srinagar Highway just outside Topcity.\r\n\r\n-26 stories Highrise covering area of 13 kanals, Latest Design, State of the Art Amenities and Smart Living Technology.\r\n\r\n-It has 3 floors for smart car parking.\r\n\r\n-There are 6 lifts, 2 service lifts, 1 cargo lift.\r\n\r\n-There are 3 swimming pools including one infinity swimming pool on roof top (first time in Pakistan).\r\n\r\n-Gym, Spa, Salon, Yoga, Kids club, 4D cinema, Banquet halls/Ball Rooms, Food courts, VIP shuttle service, 96 retail shops.\r\n\r\n-900 plus  hotel suites categorically standard, executive, presidential and only one presidential plus.\r\n\r\n-Suite owners in Signature Hotels can stay at any branch of Signature through out Pakistan. Free of Cost for a defined period.\r\n\r\n-Booking starts with\r\n25% down payment\r\n16 Quarterly Installments \r\n \r\n-Rate 33000 per square foot\r\nPresidential Suite 44,000\r\nA Presidential Plus Suite 60,000\r\n\r\nHotel Suite Sizes:\r\nThe smallest size 393sqft\r\nLarge size presidential is 995 sqft while\r\npresidential plus is 1700 sqft containing a private swimming pool.\r\n\r\nArea of all sizes suites in sqft:\r\n393,468, 523, 530, 533, 582, 575, 576,, 621, 624, 678, 712, 852, 995,1700.\r\n\r\nDiscount: 2%\r\nBut you can get 10% discount on the total payment.\r\n\r\nProfits:\r\n 40% + Annual Appreciation\r\n\r\n-Our company will be responsible for guaranteeing Monthly Profit Share as per the Hotel Occupancy Rate and managing the lifetime maintenance of your suite or shop.\r\n\r\n-If you pay your full payment in 2 years then you will start getting rent of your property.\r\n\r\n-ROI .8% on Hotel suite and .5% on shop as starting passive income.\r\nApproximately 3 Lac Rupees as monthly rental income.\r\n\r\n-Upon completion of your property installments, you will be granted ownership of your property.\r\n\r\n-Resale:\r\nIf you want to sell after paying at least 2 installments, our company will resell your property.\r\nOtherwise you can sell it whenever you want.', 'Rs.13,755,000', 'Rs.20,160,000', 215, 'active', '1656676233', '1656676233'),
(27, 'J7 Global', 'J7 Group', 'project/27/developer-logo.jpg', 'project/27/project-image.jpg', '1', 'J7 Global Mall Mumtaz City Islamabad\r\nJ7 Global! Luxury at an affordable price. J7 Global exquisite modern architect design coupled with the highest construction standard. Choose from a range of property options at your convenience.\r\n\r\n⚫ The Location of this project could not have been more ideal for business or leisure, it is located at the Junction of Motorway M-1 and M-2, G-T Road, CPEC, Ring road, and Fateh Jhang Road.\r\n\r\n⚫ Modern and unlimited amenities within your grasp, including state-of-the-art architect and top of the line quality finish and life-time after-sale services.\r\n\r\n⚫ An urban heaven with utopian living and a central location; your refined dream life awaits you in the heart of your city.\r\n\r\n⚫ Focus on the future with Inventive facilities and automated services including a 2- level Smart Car Parking.\r\n\r\nWhy invest in this project?\r\nEarthquake resistant structure\r\nJust 2km from New Islamabad International Airport on main Sriginar/Kashmir Highway in Mumtaz City.\r\n5-minute drive from the new Islamabad International Airport.\r\nA rental yield of 5-7% is expected annually.\r\nReal estate prices in the vicinity are projected to increase by 30-40% during the next 2 years.\r\nFeatures of J7 Global\r\n✅ First Ever Smart Mall in Pakistan\r\n✅Wide Atrium & Corridors\r\n✅ Extra Heighted Shops\r\n✅ Spacious Mall\r\n✅ Escalator, Elevators & travelator\r\n✅ Shops Dedicated for Brands\r\n✅ Ultra-Lavish Interior\r\n✅ 2 spacious entrances & Emergency exits\r\n✅ Indoor Smart Car Parking\r\n✅ Play Area\r\n✅ Stand by Power Generators\r\n✅ Banking facility as per mall timing\r\n✅ Disable Person Facilities\r\n✅ Monument in Atrium\r\n✅ Promotional Activities in atrium\r\n✅ Solar Glass\r\n✅ Customer Care Centre\r\n✅ Life Time Maintenance\r\n✅ What we offer?\r\n✅ Open to roof Atrium\r\n✅ Extra Heighted Shops\r\n✅ Food courts\r\n✅ Fun zone\r\n✅ Cinema\r\n✅ Health Club\r\n✅ Sauna, Spa\r\n✅ Swimming pools', '11000000', '18000000', 296, 'active', '1656762655', '1656762655');
